import React from "react";
import Common from "./Common";
import WebAbout from "./img/webabout.jpg";
const About = () => {
  return (
    <>
      <Common
        name="Welcome To About Page"
        imgsrc={WebAbout}
        visit="/contact"
        btnname="Contact Now"
      />
    </>
  );
};

export default About;
